export default function GetScoreData(data) {

    const ScoreData = {
        'homeTeam': data.hls.tn,
        'homeScore': data.hls.s,
        'awayTeam': data.vls.tn,
        'awayScore': data.vls.s,
        'time': data.cl,
        'period': data.p
    }

    return ScoreData;

}
